    render() { 
        
          return ( 
            <Layout>
         <NavBar></NavBar>
         <div className="div1" >
         <h1>djvbhj</h1>
        </div> 
            <img src ="./mainimage.jpg" width="100%" />
              <Menu1></Menu1>
     
            <style jsx>
                {`
              div.div1 {
                height: 500px;
                
              }
            
           
                `}
            </style>
                  </Layout>
           );
      }
    
}

